eval("__webpack_require__.r(__webpack_exports__);\nvar data = [{\n  name: \"Cory Booker\",\n  blurb: \"Charismatický řečník\",\n  dob: \"1969-04-27\",\n  desc: \"\\n    <p>Sen\\xE1tor za st\\xE1t New Jersey Cory Booker je soci\\xE1ln\\xED liber\\xE1l, kter\\xFD podporuje stejnopohlavn\\xED s\\u0148atky i ve\\u0159ejn\\xE9 zdravotn\\xED poji\\u0161t\\u011Bn\\xED. P\\u0159ed zvolen\\xEDm do Sen\\xE1tu p\\u016Fsobil v komun\\xE1ln\\xED politice: ve funkci starosty m\\u011Bsta Newark se stav\\u011Bl za n\\xEDzkop\\u0159\\xEDjmov\\xE9 obyvatele, prosadil v\\xFDrazn\\xE9 roz\\u0161\\xED\\u0159en\\xED v\\xFDstavby dostupn\\xE9ho bydlen\\xED a poda\\u0159ilo se mu sn\\xED\\u017Eit schodek m\\u011Bstsk\\xE9ho rozpo\\u010Dtu o v\\xEDce ne\\u017E polovinu.</p>\\n    <p>Booker je zn\\xE1m\\xFD jako charismatick\\xFD politik a zdatn\\xFD \\u0159e\\u010Dn\\xEDk, v \\u010Dem\\u017E se podob\\xE1 exprezidentu Baracku Obamovi. D\\xEDky sv\\xFDm vazb\\xE1m na byznys a finan\\u010Dn\\xED sektor si je snadno schopen zajistit financov\\xE1n\\xED kampan\\u011B, z\\xE1rove\\u0148 je ale kv\\u016Fli nim ter\\u010Dem kritiky levicov\\xFDch voli\\u010D\\u016F.</p>\\n    \"\n}, {\n  name: \"Pete Buttigieg\",\n  blurb: \"Nadějný třicátník\",\n  dob: \"1982-01-19\",\n  desc: \"\\n    <p>Pete Buttigieg je starosta indiansk\\xE9ho m\\u011Bsta South Bend a b\\xFDval\\xFD firemn\\xED konzultant. B\\u011Bhem sv\\xE9ho p\\u016Fsoben\\xED v arm\\xE1d\\u011B byl nasazen v Afgh\\xE1nist\\xE1nu. Je v\\u016Fbec prvn\\xEDm otev\\u0159en\\u011B gay kandid\\xE1tem na americk\\xE9ho prezidenta a pokud by byl zvolen, stal by se i nejmlad\\u0161\\xEDm prezidentem.</p>\\n    <p>Buttigieg se v kampani profiluje jako hlas mlad\\xFDch, m\\xE1 v\\u0161ak zku\\u0161enosti pouze s komun\\xE1ln\\xED politikou a oproti sv\\xFDm soupe\\u0159\\u016Fm je ale st\\xE1le pom\\u011Brn\\u011B nezn\\xE1m\\xFD. Jeho kandidatura se tak pova\\u017Euje sp\\xED\\u0161 za za\\u010D\\xE1tek cesty do vysok\\xE9 politiky.</p>\\n    \"\n}, {\n  name: \"Julian Castro\",\n  blurb: \"Obamovec\",\n  dob: \"1974-07-16\",\n  desc: \"\\n    <p>Nejmlad\\u0161\\xED ministr Baracka Obamy Julian Castro za\\u010D\\xEDnal jako radn\\xED a pozd\\u011Bji starosta v texask\\xE9m San Antoniu. V Obamov\\u011B kabinetu zast\\xE1val t\\u0159i roky funkci ministra bytov\\xE9 v\\xFDstavby. Ve volb\\xE1ch v roce 2016 podpo\\u0159il Hillary Clinton, kter\\xE1 o n\\u011Bm n\\xE1sledn\\u011B uva\\u017Eovala jako o kandid\\xE1tovi na viceprezidenta.</p>\\n    <p>Mezi demokraty je sp\\xED\\u0161e centristou, kter\\xFD podporuje voln\\xFD trh a v ekonomick\\xFDch ot\\xE1zk\\xE1ch ke sv\\xFDm levicov\\xFDm spolukandid\\xE1t\\u016Fm p\\u0159\\xEDli\\u0161 net\\xEDhne, by\\u0165 pat\\u0159\\xED mezi soci\\xE1ln\\xED liber\\xE1ly a podporuje nap\\u0159\\xEDklad LGBT pr\\xE1va a boj proti klimatick\\xE9 zm\\u011Bn\\u011B. Nen\\xED ov\\u0161em p\\u0159\\xEDli\\u0161 schopn\\xFDm \\u0159e\\u010Dn\\xEDkem a podle analytika BBC Anthonyho Zurchera by mu v\\xEDce slu\\u0161ela viceprezidentsk\\xE1 role.</p>\\n    \"\n}, {\n  name: \"John Delaney\",\n  blurb: \"Umírněný podnikatel\",\n  dob: \"1963-04-16\",\n  desc: \"\\n    <p>Podnikatel a b\\xFDval\\xFD kongresman John Delaney byl v \\u010Dervenci 2017 v\\u016Fbec prvn\\xEDm, kdo ozn\\xE1mil kandidaturu v p\\u0159\\xED\\u0161t\\xEDch prezidentsk\\xFDch volb\\xE1ch. Ozna\\u010Duje se za um\\xEDrn\\u011Bn\\xE9ho a ekonomicky je mezi demokraty sp\\xED\\u0161e napravo. V kampani se chce zam\\u011B\\u0159it na pracovn\\xED m\\xEDsta, vzd\\u011Bl\\xE1n\\xED a infrastrukturu.</p>\\n    <p>Koment\\xE1to\\u0159i pova\\u017Euj\\xED Delaneyho za centristu a on s\\xE1m mluv\\xED o pot\\u0159eb\\u011B stav\\u011Bt mosty mezi demokraty a republik\\xE1ny. Takov\\xE1 snaha v\\u0161ak v sou\\u010Dasn\\xE9 siln\\u011B rozd\\u011Blen\\xE9 Americe nem\\xE1 mnoho p\\u0159\\xEDznivc\\u016F, Delaney je tak mezi kandid\\xE1ty sp\\xED\\u0161e outsiderem.</p>\\n    \"\n}, {\n  name: \"Tulsi Gabbard\",\n  blurb: \"Rozporuplná veteránka\",\n  dob: \"1981-04-12\",\n  desc: \"\\n    <p>Tulsi Gabbard je kongresmanka z Havaje, prvn\\xED hinduistka v americk\\xE9m Kongresu. Slou\\u017Eila jako medi\\u010Dka ve v\\xE1lce v Ir\\xE1ku a pozd\\u011Bji v Kuvajtu. Pat\\u0159\\xED mezi levicov\\xE9 demokratick\\xE9 kandid\\xE1ty, podporuje boj proti klimatick\\xE9 zm\\u011Bn\\u011B nebo bankovn\\xED regulace a odm\\xEDt\\xE1 americk\\xE9 mezin\\xE1rodn\\xED intervence.</p>\\n    <p>Za n\\u011Bkter\\xE9 sv\\xE9 postoje je z\\xE1rove\\u0148 ter\\u010Dem kritiky. Krom\\u011B jin\\xE9ho nesouhlas\\xED s americkou \\xFA\\u010Dast\\xED ve v\\xE1lce v S\\xFDrii, kde se v roce 2017 setkala s prezidentem Ba\\u0161\\xE1rem Asadem, a zast\\xE1v\\xE1 tvrd\\u0161\\xED pozici v ot\\xE1zce migrace. Na za\\u010D\\xE1tku sv\\xE9 kari\\xE9ry nav\\xEDc vystupovala proti potrat\\u016Fm a stejnopohlavn\\xEDm s\\u0148atk\\u016Fm a propagovala l\\xE9\\u010Den\\xED homosexuality. Dnes tyto postoje vysv\\u011Btluje konzervativn\\xEDm prost\\u0159ed\\xEDm, ve kter\\xE9m vyr\\u016Fstala, a ve v\\u0161ech hlasov\\xE1n\\xEDch podporuje rovn\\xE1 lidsk\\xE1 pr\\xE1va.</p>\\n    \"\n}, {\n  name: \"Kirsten Gillibrand\",\n  blurb: \"Senátorka z hnutí #MeToo\",\n  dob: \"1966-12-09\",\n  desc: \"\\n    <p>Pr\\xE1vni\\u010Dka a sen\\xE1torka Kirsten Gillebrand je kandid\\xE1tkou, kter\\xE1 se profiluje p\\u0159ev\\xE1\\u017En\\u011B feministick\\xFDmi t\\xE9maty. Otev\\u0159en\\u011B mluv\\xED o sexismu v arm\\xE1d\\u011B i politice a podporuje hnut\\xED #MeToo. Mimo jin\\xE9 kritizuje exprezidenta Billa Clintona za skand\\xE1l s Monikou Lewinskou a \\u0159\\xEDk\\xE1, \\u017Ee Clinton m\\u011Bl v d\\u016Fsledku kauzy rezignovat - co\\u017E j\\xED m\\u016F\\u017Ee ubrat body u demokratick\\xFDch p\\u0159\\xEDznivc\\u016F Clintonov\\xFDch.</p>\\n    <p>D\\u0159\\xEDvej\\u0161\\xED ekonomicky konzervativn\\xED centristka se stejn\\u011B jako cel\\xE1 strana postupn\\u011B posunuje nalevo. Sv\\xE9 postoje zm\\u011Bnila v ot\\xE1zk\\xE1ch v\\xFDdaj\\u016F na soci\\xE1ln\\xED ochranu i kontroly dr\\u017Een\\xED zbran\\xED. Se stranickou politikou se ob\\u010Das neshoduje, ale p\\u0159\\xEDze\\u0148 demokratick\\xFDch voli\\u010Dek ji m\\u016F\\u017Ee vyn\\xE9st mezi favority.</p>\\n    \"\n}, {\n  name: \"Kamala Harris\",\n  blurb: \"Kalifornská hvězda\",\n  dob: \"1964-10-20\",\n  desc: \"\\n    <p>Kamala Harris je v boji o demokratickou nominaci u\\u017E dnes mo\\u017Enou favoritkou. Jako sen\\xE1torka a b\\xFDval\\xE1 gener\\xE1ln\\xED prokur\\xE1torka Kalifornie m\\xE1 za sebou siln\\xFD demokratick\\xFD st\\xE1t, s indicko-jamajsk\\xFDmi ko\\u0159eny tak\\xE9 symbolizuje p\\u0159\\xEDklon demokrat\\u016F k diverzit\\u011B. Ve sv\\xE9 stran\\u011B plat\\xED za jednu z nejlevicov\\u011Bj\\u0161\\xEDch: podporuje zdan\\u011Bn\\xED bohat\\xFDch, ve\\u0159ejn\\xE9 zdravotn\\xED poji\\u0161t\\u011Bn\\xED, legalizaci marihuany, p\\u0159\\xEDsnou kontrolu dr\\u017Een\\xED zbran\\xED i bezplatn\\xE9 vysoko\\u0161kolsk\\xE9 vzd\\u011Bl\\xE1n\\xED.</p>\\n    <p>P\\u0159ed p\\u016Fsoben\\xEDm v Sen\\xE1tu si z\\xEDskala pov\\u011Bst p\\u0159\\xEDsn\\xE9 prokur\\xE1torky, kter\\xE1 se ale z\\xE1rove\\u0148 stav\\u011Bla chladn\\u011B k reform\\xE1m v\\u011Bze\\u0148sk\\xE9ho syst\\xE9mu. V kampani dosud nem\\xE1 v n\\u011Bkter\\xFDch ot\\xE1zk\\xE1ch p\\u0159\\xEDli\\u0161 jasno, nap\\u0159\\xEDklad podle den\\xEDku The New York Times jsou ale u siln\\xE9ho kandid\\xE1ta schopn\\xE9ho porazit Donalda Trumpa voli\\u010Di ochotni p\\u0159e\\u0161lapy odpou\\u0161t\\u011Bt.</p>\\n    \"\n}, {\n  name: \"Amy Klobuchar\",\n  blurb: \"Senátorka z lidu\",\n  dob: \"1960-05-25\",\n  desc: \"\\n    <p>Amy Klobuchar je pr\\xE1vni\\u010Dka a od roku 2007 sen\\xE1torka za st\\xE1t Minnesota. Stejn\\u011B jako jej\\xED soupe\\u0159ka Kamala Harris m\\xE1 za sebou kari\\xE9ru prokur\\xE1torky. Jej\\xED politick\\xE9 pozice odpov\\xEDdaj\\xED mainstreamu v americk\\xE9 Demokratick\\xE9 stran\\u011B a p\\u0159edch\\xE1z\\xED j\\xED pov\\u011Bst sympatick\\xE9, ale v p\\u0159\\xEDpad\\u011B pot\\u0159eby ostr\\xE9 politi\\u010Dky, kterou prok\\xE1zala mimo jin\\xE9 p\\u0159i lo\\u0148sk\\xE9m schvalov\\xE1n\\xED soudce Nejvy\\u0161\\u0161\\xEDho soudu Bretta Kavanaugha.</p>\\n    <p>Jej\\xED priority pokr\\xFDvaj\\xED \\u0161irok\\xE9 spektrum oblast\\xED, od levn\\u011Bj\\u0161\\xEDch l\\xE9k\\u016F p\\u0159es rychlej\\u0161\\xED internet a bezpe\\u010Dn\\u011Bj\\u0161\\xED volby po p\\u0159\\xEDsn\\u011Bj\\u0161\\xED antimonopoln\\xED z\\xE1kony. I p\\u0159es jasn\\u011B liber\\xE1ln\\xED postoje se j\\xED da\\u0159\\xED prezentovat se jako um\\xEDrn\\u011Bn\\xE1 politi\\u010Dka ochotn\\xE1 ke kompromis\\u016Fm, co\\u017E j\\xED m\\u016F\\u017Ee pomoci u st\\u0159edov\\u011Bj\\u0161\\xEDch demokratick\\xFDch voli\\u010D\\u016F.</p>\\n    \"\n}, {\n  name: \"Bernie Sanders\",\n  blurb: \"Známá firma\",\n  dob: \"1941-09-08\",\n  desc: \"\\n    <p>Dob\\u0159e zn\\xE1m\\xFD soupe\\u0159 Hillary Clinton z posledn\\xEDch demokratick\\xFDch prim\\xE1rek to ani tentokr\\xE1t nebude m\\xEDt jednoduch\\xE9. Kampa\\u0148 Bernieho Sanderse v roce 2016 posunula celou Demokratickou stranu doleva - jen\\u017Ee t\\xEDm se jeho d\\u0159\\xEDve odv\\xE1\\u017En\\xE9 leviciv\\xE9 postoje znormalizovaly a zast\\xE1v\\xE1 je i nemal\\xE1 \\u010D\\xE1st jeho soupe\\u0159\\u016F.</p>\\n    <p>Sanders m\\u016F\\u017Ee st\\xE1le t\\u011B\\u017Eit ze sv\\xE9 popularity a j\\xE1dra voli\\u010D\\u016F i dobrovoln\\xEDk\\u016F, kter\\xE9 z\\xEDskal v posledn\\xED kampani. Proti n\\u011Bmu ov\\u0161em hraje jednak jeho v\\u011Bk - pokud by se stal prezidentem, bude to v jeho 79 letech - jednak oproti minul\\xFDm volb\\xE1m zapln\\u011Bn\\xE9 pole neokoukan\\xFDch spolukandid\\xE1t\\u016F, kte\\u0159\\xED v\\xEDce odpov\\xEDdaj\\xED p\\u0159edstav\\u011B demokrat\\u016F o progresivn\\xED stran\\u011B diverzity.</p>\\n    \"\n}, {\n  name: \"Elizabeth Warren\",\n  blurb: \"Těžká váha levice\",\n  dob: \"1949-06-22\",\n  desc: \"\\n    <p>Sen\\xE1torka za st\\xE1t Massachusetts a expertka na obchodn\\xED pr\\xE1vo Elizabeth Warren je jednou z nejv\\xFDrazn\\u011Bj\\u0161\\xEDch tv\\xE1\\u0159\\xED levicov\\xE9ho k\\u0159\\xEDdla Demokratick\\xE9 strany. B\\xFDval\\xE1 akademi\\u010Dka v Sen\\xE1tu prosazuje ochranu spot\\u0159ebitel\\u016F, podporu ni\\u017E\\u0161\\xED a st\\u0159edn\\xED t\\u0159\\xEDdy a p\\u0159\\xEDsnou kontrolu finan\\u010Dn\\xEDho sektoru.</p>\\n    <p>Elizabeth Warren pat\\u0159\\xED mezi v demokratick\\xFDch prim\\xE1rk\\xE1ch mezi favority. Spolu s Berniem Sandersem pat\\u0159\\xED mezi dlouholet\\xE9 bojovn\\xEDky proti velk\\xE9mu kapit\\xE1lu. Proti n\\xED ale m\\u016F\\u017Ee hr\\xE1t fakt, \\u017Ee p\\u016Fsob\\xED a\\u017E p\\u0159\\xEDli\\u0161 jako profesion\\xE1ln\\xED politi\\u010Dka a chyb\\xED j\\xED z\\xE1pal, jak\\xFD v minul\\xE9 kampani p\\u0159edvedl pr\\xE1v\\u011B Sanders.</p>\\n    \"\n}, {\n  name: \"Marianne Williamson\",\n  blurb: \"Duchovní outsiderka\",\n  dob: \"1952-07-08\",\n  desc: \"\\n    <p>Marianne Williamson je americk\\xE1 charitativn\\xED aktiviska a \\u201Educhovn\\xED u\\u010Ditelka\\u201C. Do politiky p\\u0159ich\\xE1z\\xED jako outsiderka - za sebou m\\xE1 pouze ne\\xFAsp\\u011B\\u0161nou nez\\xE1vislou kandidaturu do Kongresu v roce 2014. Zn\\xE1m\\xE1 je ale d\\xEDky sv\\xFDm bestseller\\u016Fm a tak\\xE9 z televizn\\xEDch obrazovek, mimo jin\\xE9 d\\xEDky show americk\\xE9 televizn\\xED legendy Oprah Winfrey.</p>\\n    <p>N\\xE1zorov\\u011B se podle vlastn\\xEDch slov nejv\\xEDce shoduje s Berniem Sandersem a Elizabeth Warren, na rozd\\xEDl od nich ale do politiky p\\u0159ich\\xE1z\\xED zvenku podobn\\u011B jako Donald Trump. Jej\\xED kandidatura uk\\xE1\\u017Ee, jak jsou demokrat\\xE9 ochotni v tomto sm\\u011Bru j\\xEDt v republik\\xE1nsk\\xFDch stop\\xE1ch - pokud tedy nebude kandidovat zm\\xEDn\\u011Bn\\xE1 Oprah Winfrey, o \\u010Dem\\u017E se v posledn\\xEDch letech spekulovalo n\\u011Bkolikr\\xE1t.</p>\\n    \"\n}, {\n  name: \"Andrew Yang\",\n  blurb: \"Nápaditý byznysmen\",\n  dob: \"1975-01-13\",\n  desc: \"\\n    <p>Podnikatel Andrew Yang kandiduje na prezidenta po dvacetilet\\xE9 zku\\u0161enosti se start-upy. Je autorem knih, kter\\xE9 se zab\\xFDvaj\\xED automatizac\\xED pr\\xE1ce, a prezidentsk\\xE1 kandidatura je jeho prvn\\xED zku\\u0161enost s politikou. Je v\\u016Fbec prvn\\xEDm kandid\\xE1tem s asijsk\\xFDmi ko\\u0159eny.</p>\\n    <p>Jeho sloganem je \\u201EHumanity First\\u201C (lidstvo p\\u0159edev\\u0161\\xEDm) a do kampan\\u011B jde s jednou hlavn\\xED my\\u0161lenkou: zaveden\\xEDm nepodm\\xEDn\\u011Bn\\xE9ho z\\xE1kladn\\xEDho p\\u0159\\xEDjmu 1000 dolar\\u016F m\\u011Bs\\xED\\u010Dn\\u011B pro ka\\u017Ed\\xE9ho Ameri\\u010Dana. Krom\\u011B n\\xED ale voli\\u010D\\u016Fm mnoho nenab\\xEDz\\xED a je v roli outsidera. Jeho hlavn\\xEDm \\xFAsp\\u011Bchem m\\u016F\\u017Ee b\\xFDt, \\u017Ee jeho n\\xE1pad se z\\xE1kladn\\xEDm p\\u0159\\xEDjmem p\\u0159evezmou dal\\u0161\\xED kandid\\xE1ti.</p>\\n    \"\n}];\n/* harmony default export */ __webpack_exports__[\"default\"] = (data);\n\n//# sourceURL=webpack:///./js/data.js?");

